import React, { useState, useEffect } from 'react';
import axios from 'axios';

const RandomImages = () => {
  const [randomImages, setRandomImages] = useState([]);
  const [searchPerformed, setSearchPerformed] = useState(false);

  useEffect(() => {
    // Fetch random images from Unsplash List Photos API
    axios
      .get('https://api.unsplash.com/photos/random', {
        params: {
          count: 10, // Number of random images to fetch
        },
        headers: {
            Authorization: `Client-ID mxIVjm1S9JohgUXlEdfJgNggR5wR7_z7Jdd5ecEMC5Q`,
        },
      })
      .then((response) => {
        setRandomImages(response.data);
      })
      .catch((error) => {
        console.error(error);
      });
  }, []);

  return (
    <div className={`random-images-container ${searchPerformed ? 'hidden' : ''}`}>
      {randomImages.map((image) => (
        <div key={image.id} className="random-image bg-white p-4 rounded-md shadow-md">
          <img src={image.urls.small} alt={image.alt_description} />
          <div className="image-details mt-4">
            <p className="text-sm">User: <a href={`https://www.instagram.com/${image.user.instagram_username}`} target="_blank" rel="noopener noreferrer" className="text-blue-500">{image.user.name}</a></p>
            <p className="text-sm flex items-center"><i className="far fa-heart text-red-500 mr-1"></i>Likes: {image.likes}</p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default RandomImages;
